        <link rel="icon" href="/favicon.ico" />
        <meta charset="UTF-8" />
      </Head>

	<main>
    
    <ul>
    {questions.map(function(q,i){
    	return <li><blockquote style={{color:"green"}} contentEditable={true}>{q.q}</blockquote><p style={{color:"red"}}>{q.a}</p></li>
    })}
    </ul>
	</main>

<Navigation />
</div>

)

}

